import TopNav from './TopNav.js';
import MainNav from './MainNav.js';
import Container from './Container.js';
import Search from './Search.js';
import Curation from './Curation.js';
import CategoryCourses from './CategoryCourses.js';
import './Main.css';

function Main() {
    return (
        <div>
            <TopNav />
            <MainNav />
            <Container />
            <Search />
            <Curation />
            <CategoryCourses title="나와 비슷한 사람들이 수강한 강의" courses={[]}/>
            <CategoryCourses title="내가 학습한 Java 분야 인기 강의" courses={[]}/>
            <CategoryCourses title="내가 학습한 Spring 분야 인기 강의" courses={[]}/>
        </div>
    )
}

export default Main;
